@use 'abstracts/' as *;


.nav-bar {
    width: 100%;
    height: 60px;
    position: fixed;
    z-index: 999;
    color: $white;
    background-color: $black;
    padding: 5px 40px;
    display: flex;
    justify-content: space-between;
    align-content: center;
    align-items: center;

    .logo {
        color: $red;
        text-transform: uppercase;
        width: 50%;
        font-size: $heading;
    }

    .nav-links {
        display: flex;
        list-style: none;
        li a {
            text-decoration: none;
            color: $white;
            text-transform: uppercase;
            font-weight: $bold;
            font-size: $regular;
            margin-left: 3rem;


        }
    }
}
